import React from "react";

const ProjectCard = ({ title, date, concept, imgPath }) => {
  const styles = {
    cardContainer: {
      //   fontSize: "50px",
    },
    cardTitle: {
      fontSize: "72px",
      fontWeight: "800",
      textTransform: "capitalize",
    },
    cardType: {
      fontSize: "50px",
      fontWeight: "800",
      textTransform: "capitalize",
    },
    cardDate: {
      fontSize: "50px",
      fontWeight: "800",
      textTransform: "capitalize",
    },
  };

  const displayCard = (
    <div className="my-3" style={styles.cardContainer}>
      <div className="row ">
        <div className="col-md-4">
          <img src={imgPath} className="img-fluid rounded-start" alt={title} />
        </div>
        <div className="col-md-8">
          <div className="card-body">
            <div style={styles.cardType}>PROJECT</div>
            <div style={styles.cardTitle}>{title}</div>
            <p>
              <small className="text-muted">{date}</small>
            </p>
            <p>{concept}</p>
          </div>
        </div>
      </div>
    </div>
  );

  return <div>{displayCard}</div>;
};

export default ProjectCard;
